        function initCesium() {
        var viewer = new Cesium.Viewer('cesiumContainer', {
            navigationHelpButton: false,
            navigationInstructionsInitiallyVisible: false,
            geocoder: false,
            baseLayerPicker: false,
            timeline: false,
            terrainExaggeration: 10.0
        }); 
        
        viewer.scene.screenSpaceCameraController.inertiaSpin = 0.99;
        
        viewer.scene.moon = new Cesium.Moon();
        viewer.scene.sun = new Cesium.Sun();
        viewer.scene.sun.glowFactor = 1.0;
        
        
        cesiumTerrainProviderMeshes = new Cesium.CesiumTerrainProvider({
            url: '//assets.agi.com/stk-terrain/world',
            requestWaterMask: true,
            requestVertexNormals: true
        });
        viewer.terrainProvider = cesiumTerrainProviderMeshes;
    
        var center = Cesium.Cartesian3.fromDegrees(21, 52);
          
        viewer.scene.globe.enableLighting = true;
        
        fog = new Cesium.Fog();
        fog.density = 0.0005;
        fog.screenSpaceErrorFactor = 100.0;    
        
                
        viewer.entities.add({
            id: 'ISS',
            billboard : {
                image:"data:image/png;base64,",
                scale:0.18
            }
        });
        iss = viewer.entities.getById('ISS');                              
        //iss.position = Cesium.Cartesian3.fromDegrees(90, 0, 408000);
          
        var fadedLine = new Cesium.StripeMaterialProperty({
            oddColor: Cesium.Color.YELLOW,
            evenColor: Cesium.Color.BLACK,
            repeat: 1,
            offset: 0.2,
            orientation: Cesium.StripeOrientation.VERTICAL
        });
                 
        
        
                                    
        iss.polyline = new Cesium.PolylineGraphics();                       
        iss.polyline.material = fadedLine;  
        var currentLat; 
        var currentLong;
        var textLocation = 'test';
                               
        /* location data */
        setInterval(function() {
    
          //Cesium JDN to Unix timestamp 
          var timestamp = Math.floor((viewer.clock.currentTime.dayNumber-2440588)*24*60*60+12*60*60+viewer.clock.currentTime.secondsOfDay);
          
          var timeArray = Array();
          for (var i = 0; i<10; i++) {
          timeArray.push(timestamp - i*10*60);
          }
          
          var oReq = new XMLHttpRequest();
          var positionsUrl = 'https://api.wheretheiss.at/v1/satellites/25544/positions?timestamps='+timeArray.join()+'&units=kilometers';
          oReq.open("GET", positionsUrl, true);
          oReq.onload = function (oEvent) {
              if (oReq.readyState === oReq.DONE) {
                  if (oReq.status === 200) {            
                      var myObj = JSON.parse(this.responseText);   
                      currentLat = myObj[0].latitude;
                      currentLong = myObj[0].longitude;
                      let txt = 'ISS Location: ' +currentLat+','+currentLong; 
                      if (textLocation != '') txt = txt + ' ('+textLocation + ')';
                      document.getElementById('coordinatesText').innerHTML = txt;
                      console.log(currentLat+','+currentLong);
                      //update spaceship position
                      iss.position = Cesium.Cartesian3.fromDegrees(currentLong, currentLat, myObj[0].altitude*1000);
                                    
                      var degreesArray = Array();
                      for (var i = 0; i<10; i++) {
                      degreesArray.push(myObj[i].longitude);
                      degreesArray.push(myObj[i].latitude);
                      degreesArray.push(myObj[0].altitude*1000);
                      }                                     
                      // orbit path is not a perfect circle on the map - because of Earth's rotation around its axis.
                      iss.polyline.positions = Cesium.Cartesian3.fromDegreesArrayHeights(degreesArray);
                      
                                        
                  }
              }
          };
          oReq.send(null);    
          
        }, 2000);    
        
                                
        setInterval(function() {
          
          var oReq = new XMLHttpRequest();
          console.log("http://api.geonames.org/countrySubdivisionJSON?lat="+currentLat+"&lng="+currentLong+"&maxRows=10&radius=40&username=georevacc");
          oReq.open("GET", "http://api.geonames.org/countrySubdivisionJSON?lat="+currentLat+"&lng="+currentLong+"&maxRows=10&radius=40&username=georevacc", true);
          oReq.onload = function (oEvent) {
              if (oReq.readyState === oReq.DONE) {
                  if (oReq.status === 200) {            
                  var myRevGC = JSON.parse(this.responseText);               
                  if (('countryName' in myRevGC))
                  {
                  textLocation = myRevGC.countryName;
                  console.log(textLocation);
                  } 
                  else {  
                                           
                      var oReq2 = new XMLHttpRequest();
                      oReq2.open("GET", "http://api.geonames.org/oceanJSON?lat="+currentLat+"&lng="+currentLong+"&username=georevacc", true);
                      oReq2.onload = function (oEvent) {
                          if (oReq2.readyState === oReq2.DONE) {
                              if (oReq2.status === 200) {          
                              var myRevGC = JSON.parse(this.responseText); 
                              if (('ocean' in myRevGC))
                              textLocation = myRevGC.ocean.name;
                              else textLocation = '';
                              console.log(textLocation);
                              
                              }
                              }
                          }    
                          
                      oReq2.send(null);   
                  }  
                  
                          
                  }
                  }
              }    
              
          oReq.send(null);    
          }   
          
        , 5000);                                       
        
        viewer.camera.setView({
            destination : Cesium.Cartesian3.fromDegrees(
                15.0,
                32.0,
                20000000.0
            )
        });
        
        var ra = 0;
        var clicked = false;
        var handler = new Cesium.ScreenSpaceEventHandler(viewer.scene.canvas);
        var lastClick;
        handler.setInputAction(function(click) {
        clicked = true;
        viewer.camera.cancelFlight();
        lastClick = setTimeout (function(){clicked=false;}, 60000);
        }, Cesium.ScreenSpaceEventType.LEFT_DOWN 
        );handler.setInputAction(function(click) {
        clicked = true;        
        if (lastClick != null)
        clearTimeout(lastClick);                     
        viewer.camera.cancelFlight();
        setTimeout (function(){clicked=false;}, 60000);
        }, Cesium.ScreenSpaceEventType.LEFT_UP 
        );
        var autorotate = setInterval(function() {
        ra++;
        if (ra > 360)
        ra = 0;
                              
        if (clicked == false)  
        viewer.camera.flyTo({
                          destination: Cesium.Cartesian3.fromDegrees(0+ra, 0, 20000000),
                          duration: 0,
                      }); 
                      
        }, 50);    
        
        
    }
    